import { FaShoppingCart } from 'react-icons/fa';

const CartIcon = ({ cartCount }) => {
  return (
    <div style={{ position: 'relative', display: 'inline-block', fontSize: '1rem' }}>
      <FaShoppingCart />
      {cartCount > 0 && (
        <span style={{
          position: 'absolute',
          top: '-8px',
          right: '-10px',
          background: 'crimson',
          borderRadius: '50%',
          padding: '2px 6px',
          fontSize: '0.7rem',
          color: 'white',
          fontWeight: 'bold'
        }}>
          {cartCount}
        </span>
      )}
    </div>
  );
};

export default CartIcon;
